import PropTypes from 'prop-types'



export default function UserItem(props){
    const styles ={
        button:{
            backgroundColor: 'green', 
            marginRight: '1rem',
            minWidth: '6rem'
        },


    }
    return(
        <tr>
            <td>{props.user.name}</td>
            <td>{props.user.lastName}</td>
            <td>{props.user.age}</td>
            <td>{props.user.sex}</td>
            <td className='editing'><form style={styles.form}><button style={styles.button}>Remove</button><button style={styles.button}>Edit</button></form></td>
        </tr>
    )
}
